import React,{useState,useEffect} from 'react';
import DiwaliItems from './DiwaliItems.js';


const Diwali = () => {

  const[items, setItems] = useState(DiwaliItems);

    const filterItem = (categItem) => {
        const updatedItems = DiwaliItems.filter((curElem) => {
            return curElem.category === categItem;
        });

        setItems(updatedItems);
  }

  const [data,setData]=useState([]);
  const getData=()=>{
    fetch('DiwaliItems.json'
    ,{
      headers : { 
        'Content-Type': 'application/json',
        'Accept': 'application/json'
       }
    }
    )
      .then(function(response){
        console.log(response)
        return response.json();
      })
      .then(function(myJson) {
        console.log(myJson);
        setData(myJson)
      });
  }
  useEffect(()=>{
    getData()
  },[])
  return (
    <>
    
    
  
    <div className="row my-3">
     {
       data && data.length>0 && data.map((item)=>{
         return <DiwaliItems item={item} />
       })
      //  data && data.length>0 && data.map((item)=><p>{item.email}</p>)
     }
    </div>
    </>
  );
}

export default Diwali;
